import React from "react";
import { styled } from "styled-components";

const CryptoWrapper = styled.div`
  padding: 1rem 2rem;
  width: 100%;
  height: 80px;
  display: flex;
  img {
    width: 40px;
  }
`;
const CryptoNames = styled.div`
  display: flex;
  flex-direction: column;
`;

function Crypto({ fullName, price, ticker, change, logo }) {
  return (
    <CryptoWrapper>
      <div className="">
        <img src={logo} alt="" />
      </div>
      <CryptoNames className="">
        {fullName} {ticker}
      </CryptoNames>
      {price} {change} :
    </CryptoWrapper>
  );
}

export default Crypto;
